import React from 'react'
import Signinbtn from '../SignIn-Btn/Signinbtn'
import "./Navbar.css"
const Navbar = () => {
    return (
       <nav className='navbar'>
           <h3>React Social</h3>
           <Signinbtn />
       </nav>
    )
}

export default Navbar
